  input: '"TEXT","F3XA","C00034033","This amendment reflects debt on Schedule D that
    the South Carolina Republican Party (SCGOP) federal account owes the SCGOP nonfederal
    account for administrative and overhead expenses that were improperly disbursed
    from the nonfederal account.  Reporting the disbursements that were done improperly
    in an amended Schedule H4 would have made it impossible to reconcile the cash
    balance on line 8 of the Form 3X summary schedule.  Therefore, in consultation
    with Jane Parks, we were advised to report the correction of the improper disbursements
    reflecting only the debt on Schedule D.  The SCGOP is now utilizing procedures
    that properly allocate all the administrative, generic voter drive, and fundraising
    program/event expenses between our federal and nonfederal accounts."'
